    value: '2nd AMENDMENT DESCRIPTION: Report is being amended to properly disclose
      the fundraising allocation ratio on Schedule H2.     1st AMENDMENT DESCRIPTION:   1.
      This report is being amended to correct the Calendar Year-To-Date figures in
      Column B for lines 6c, 6d, 7, 11(a)(i), 11(a)(ii), 11(a)(iii), 11(d), 19, 20,
      21(a)(i), 21(a)(ii), 21(b), 21(c), 30(b), 30(c), 31, 32, 33, 35, 36 and 38 due
      to amendments filed for the October Monthly Report (7/1/07-9/30/07) after the
      December Monthly Report (11/1/07-11/30/07) was filed. Contributions totaling
      $155 were previously reported as unitemized, but duplicate records have been
      corrected and merged since this report was originally filed and now the $155
      is reported included in the itemized figure for this month and Calendar Year-to-Date.    2.
      The itemized detail for payment of $1,409.33 to Richard Swarttz on 11/1/07 on
      page 155 of the report begins at the bottom of page 223 with Shell and ends
      on page 228 with HOPS. This was linked to an item on Schedule D and wouldnt
      print directly after the expenditure.    3. The description for the payments
      to Hospitality & Event Staff, Inc. reported on Schedule H4 have been changed
      to reflect a more accurate description. This company was hired to assist with
      set up and take down for a General Party function.    4. Debts and Obligations
      balance is being reported as $1,094,342.91. The original report reflected a
      total balance due for Debts and Obligations of $1,097,234.58 (a difference of
      $2,891.67). The original report included a balance due to Yuma Solutions of
      $34,215.58. As noted in the memo attached to the Year End Report (12/1/07-12/31/07),
      it was discovered that this balance inadvertently included a bill in the amount
      of $2,891.67 that was a non-federal expenditure and subsequently paid out of
      the non-federal account.     5. The debt due to Rosen Shingle Creek Golf Club
      of $741,634.50 is a debt that should have been reflected on the Amended report
      for 10/1/07-10/31/07, as it was originally reported on that report, however
      it was inadvertently missing. It is included on this report.     No expenditure
      was made on behalf of a specifically identified federal candidate. No expenditure
      was for a public communication that referred to a clearly identified candidate
      for Federal office and that promoted, supported, attacked or opposed any such
      candidate for Federal office. All disbursements for salaries and benefits disclosed
      on Schedule H4 are for employees who did not spend more than 25% of their compensated
      time during the reporting period on Federal election activities or activities
      in connection with a Federal election. The Committee uses the Escrow option
      for receipt of corporate in-kind donations as provided for by the Commission
      in Advisory Opinion 1992-33. The method ensures that prohibited sources are
      not used to fund the federal share of allocable activity expenses.   Administrative
      Escrow account and In-kinds  11/01/07 balance is $28,518.95  11/2/07 EMV Aircraft
      in-kind of $2,866.20 as reflected on Sch H4 and transfer on Sch H3 using $802.54
      of escrow balance.  11/28/07 Communications Intl in-kind of $4,550 as reflected
      on Sch H4 and transfer on Sch H3 using $1,274 of escrow balance.  11/30/07 balance
      in Administrative escrow account of $26,442.41.  MD-08 Escrow account and In-kinds  11/1/07
      balance is $73,697.20  11/7/07 transfer to MD-08 escrow account of $5,000 as
      reflected on Sch H4  11/14/07 MBA Graphics of Tampa in-kind of $2,505 as reflected
      on Sch H4 and transfer on Sch H3 using $200.40 of escrow balance.  11/30/07
      balance in MD-08 escrow account of $78,496.80.  '
